import React from "react";
import './Botton.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';

function Botton(){
    return(
        <div className="Botton">

            <button>No dar click</button>

        </div>
    )
}

export default Botton;
